import React from "react";
import "./Login.css";
import { NavLink } from "react-router-dom";
function Login() {
  return (
    <div className=" login ">
      <NavLink to="/">
        <img
          className="login__Image"
          src={require("./image/best-deal.png")}
          alt="no able"
        />
      </NavLink>

      <div className="login__container">
        <h1>Sign-in</h1>
        <from>
          <h5>E-mail</h5>
          <input type="text" />
          <h5>Password</h5>
          <input type="password" />
          <button>Sign In</button>
        </from>
        <p>
          Please review our Privacy Notice, which also governs your visit to
          Amazon.in, to understand our practices. The personal information /
          data provided to us by you during the course of usage of bestdeal.in </p>
         <button>Create a new account</button>
      </div>
    </div>
  );
}

export default Login;
